'''Admiral Bake''' was a famous [[gnome]] explorer from the [[Fourth Age]].{{CiteNPC|npc=Hazelmere|loc=The Eyes of Glouphrie|quote=I have a story to tell you that will answer most of your questions. Let us travel back in time, to the time you humans call the Fourth Age.|notes=Cutscene shows [[King Healthorg]] mounted on [[Mibbiwocket]], who was a gift from Admiral Bake.}} He was best known for presenting the [[tortoise]] [[Mibbiwocket]] to [[King Healthorg]] the Great shortly after its birth.{{CiteNPC|npc=Natural historian|loc=Varrock Museum|quote=The oldest tortoise ever recorded was Mibbiwocket, who was presented to the King Healthorg the Great, by the famous explorer Admiral Bake, shortly after its birth.|name=Tortoise}} This tortoise would go on to become the world's oldest tortoise.{{NamedRef|Tortoise}}

Admiral Bake is the correct answer to the [[Natural history quiz]] question: ''"Name the explorer who discovered the world's oldest tortoise."''{{CiteNPC|npc=Orlando Smith|loc=Natural history quiz|quote=Name the explorer who discovered the world's oldest tortoise.}}

